import { Component, OnInit } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import '../assets/Cardo-Regular-normal.js';
import '../assets/Tangerine-Regular-normal.js';
import { jsPDF } from 'jspdf';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent implements OnInit{
  title = 'jspdf-certificate';
  certificateForm: FormGroup;
  submitted= false;
  date: string
  certificateImg = 'data:image/png;base64,'

  constructor(private formBuilder: FormBuilder) {}
  ngOnInit(): void {
    this.certificateForm = this.formBuilder.group({
      name: ['', Validators.required]
    });
    let currentDate = new Date;
    let dd = String(currentDate.getDate()).padStart(2, '0');
    let mm = String(currentDate.getMonth()+1).padStart(2, '0');
    let yy = currentDate.getFullYear();

    this.date = mm + '/' + dd + '/' + yy;
  }
  
  get f() {
    return this.certificateForm.controls;
  }

  onSubmit() {
    this.submitted = true
    if(this.certificateForm.invalid) return;

    console.log(this.f.name.value)

    let doc = new jsPDF({
      orientation: 'landscape'
    })
    doc.addImage(this.certificateImg, 0, 0, 297, 210);
    doc.setFontSize(72);
    doc.setTextColor(0, 0, 0);
    doc.setFont('Tangerine-Regular', 'normal');
    doc.text(this.f.name.value, (doc.internal.pageSize.width / 2), 122, {align:'center'});


    doc.setFont('Cardo-Regular', 'normal');
    doc.setFontSize(18);
    doc.text(this.date, 247, 186, {align:'center'}); 
    doc.save("Certificate.pdf");
  }
}
